import React from 'react'

import ReactLoading from 'react-loading'

import styles from './LoadingComponent.module.scss'

const Loading = ({
  type, color, height, width, className,
}) => (
  <div className={styles.container}>
    <ReactLoading
      type={type}
      color={color}
      height={height}
      width={width}
      className={className}
    />
  </div>
)
export default Loading
